import React from 'react'

function Home() {
    return (
        <div className="home">

            <img className="home__image" src="https://images-eu.ssl-images-amazon.com/images/G/31/AmazonVideo/2020/X-site/Multititle/Aug/1500x600_Hero-Tall_np._CB407694131_.jpg" alt="back"></img>

        </div>
    )
}

export default Home
